import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Homepage from './Home';

const App = () => {
  return (
    <Switch>
      <Routes>
        <Route path="/home" component={Homepage} />
      </Routes>
    </Switch>
  );
};


export default App;
